import React from "react";
import "./style.css";
import { Images } from "./../../config/image";
function Component_Block_Last() {
  return (
    <div>
      <div style={{ paddingTop: "40px" }}>
        <div className="box-all">
          <div>
            <img
              src={Images.FACE_1}
              style={{
                width: "60px",
                height: "60px",
                borderRadius: "50%",
                position: "absolute",
                right: "75px",
                top: "-30px",
              }}
            />
          </div>
        </div>
      </div>
    </div>
  );
}
export default Component_Block_Last;
